import React from "react";
import {  BrowserRouter,  Route,  Routes} from 'react-router-dom';
import Notes from './Notes'

function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route path="/notes">
      <Notes />
    </Route>
    </Routes>
</BrowserRouter>
  )
}

export default App
